package tcs.ril.storebot.model;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;public class ProfilePic {    @SerializedName("tag")    @Expose    String tag;    @SerializedName("name")    @Expose    String name;    @SerializedName("altText")    @Expose    String altText;    @SerializedName("url")    @Expose    String url;    @SerializedName("size")    @Expose    String size;    public String getTag() {        return tag;    }    public void setTag(String tag) {        this.tag = tag;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getAltText() {        return altText;    }    public void setAltText(String altText) {        this.altText = altText;    }    public String getUrl() {        return url;    }    public void setUrl(String url) {        this.url = url;    }    public String getSize() {        return size;    }    public void setSize(String size) {        this.size = size;    }}